import React from 'react';

const Synaxarium = () => {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold text-gray-900 mb-8">السنكسار</h1>
      <div className="bg-white rounded-lg shadow-md p-6">
        <p className="text-gray-600">صفحة السنكسار - قيد التطوير</p>
      </div>
    </div>
  );
};

export default Synaxarium;
